import org.junit.Test;

import java.util.HashMap;

public class P242_有效的字母的异位词 {
    public boolean isAnagram(String s, String t) {
        HashMap<Character, Integer> hs = new HashMap<>();
        if(s.length() != t.length()) {
            return false;
        }
        for (int i = 0; i < s.length(); i++) {
            hs.put(s.charAt(i),
                    hs.getOrDefault(s.charAt(i),  0) + 1);
        }
        int matches = 0;
        HashMap<Character, Integer> now = new HashMap<>();
        for (int i = 0; i < t.length(); i++) {
            if(hs.containsKey(t.charAt(i))) {
                now.put(t.charAt(i),
                        now.getOrDefault(t.charAt(i),0) + 1);
                if(hs.get(t.charAt(i)).equals(now.get(t.charAt(i)))) {
                    matches++;
                }else if(hs.get(t.charAt(i)) < now.get(t.charAt(i))) {
                    return false;
                }
            }else{
                return false;
            }
        }
        return matches == hs.size();
    }

    @Test
    public void test() {
        String s1 = "";
        String s2 = "";
        System.out.println(isAnagram(s1,s2));
    }
}
